//    --------------------OPTIMAL -> O(N), O(N)---------------
    public String removeKdigits(String num, int k) {
        if(num.length()==k) return "0";
        char[] arr=num.toCharArray();
        int top=-1;
        for(char c: num.toCharArray()) {
            while(top>=0 && k>0 && arr[top]>c) {
                top--;
                k--;
            }
            top++;
            arr[top]=c;
        }
        while(k>0 && top>0) {
            top--;
            k--;
        }
        int i=0;
        while(i<top && arr[i]=='0') {
            i++;
        }
        return new String(arr).substring(i, top+1);
    }
    
    
    
